Service Finder WordPress Theme provides OTP system at the time of booking. OTP (One Time Password) system prevent fake booking. So whenever customer tries to make any booking then an OTP will be sent to their email address they have entered in the booking form. Customer has to enter the OTP and verify it then only he can move ahead to complete the booking process.

<img class="aligncenter" src="http://aonetheme.com/demo/wp-content/themes/service-finder/inc/images/features/booking-3-step.jpg" alt="" />

&nbsp;

Service Finder WordPress Theme offers unlimited providers categories. You can find this option in users section of WordPress dashboard. Add as many as you want, give their child categories. 

<img src="http://aonetheme.com/demo/wp-content/themes/service-finder/inc/images/features/category.jpg" alt="" />

&nbsp;

Service Finder WordPress Theme come up with Sign Up Restriction option. Admin can select countries from theme optionsso only providers from those selectedcountries can signup.

All Countries: If adminenable this option then providers from any country can signup.

&nbsp;

<img src="http://aonetheme.com/demo/wp-content/themes/service-finder/inc/images/features/sign-up-restriction.jpg" alt="" />

&nbsp;

