Autocomplete is a feature of the Places library in the Google Maps JavaScript API.When a user starts typing an address, autocomplete will fill in the rest.

<img class="aligncenter" src="http://aonetheme.com/demo/wp-content/themes/service-finder/inc/images/features/auto-complete-google-script.jpg" alt="" />

&nbsp;

<img class="aligncenter" src="http://aonetheme.com/demo/wp-content/themes/service-finder/inc/images/features/auto-complete-google-script2.jpg" alt="" />

&nbsp;

Service Finder WordPress Theme gives option for customer to make booking as Guest. They can make booking without login. Provider can generate invoice for Guest customer and send to their email address. Customer can pay invoice by clicking pay now button in email.

&nbsp;

<img src="http://aonetheme.com/demo/wp-content/themes/service-finder/inc/images/features/as-guest-booking.jpg" alt="" />

Add to favorites option allow user to add service provider/business to their favorites lists. They can remove them from their favorite lists any time.

<img class="aligncenter" src="http://aonetheme.com/demo/wp-content/themes/service-finder/inc/images/features/add-to-favorites.jpg" alt="" />

